import React from "react";
import ReactDOM from "react-dom";
import state, { subscribe } from "./redux/state";
import App from "./App";
import { BrowserRouter } from "react-router-dom";
import store, { addPosts, updateNewText } from "./redux/state";

export const renderReactTree = () => {
    ReactDOM.render(
        <BrowserRouter>
            <App store={store} addPosts={addPosts} updateNewText={updateNewText} />
        </BrowserRouter>,
        document.getElementById("root")
    );
};

renderReactTree(state);

subscribe(renderReactTree);
